from typing import List
class Solution:
    def shortestBridge(self, A: List[List[int]]) -> int:
        # self.edges = [0,0,set()]
        self.edges = set()

        # mark two island as 1 and 2
        def mark(i, j, island):
            A[i][j] = island
            for p, q in [(i+1,j),(i-1,j),(i,j+1),(i,j-1)]:
                if 0 <= p < len(A) and 0 <= q < len(A[0]):
                    if A[p][q] == 1:
                        mark(p, q, island)
                    else:
                        self.edges.add((p,q))
            return

        s1 = None
        for i in range(len(A)):
            for j in range(len(A[0])):
                if A[i][j] == 1:
                    s1 = (i,j)
                    mark(i, j, 2)
                    break
            if s1:
                break
        
        # now we differentiated 2 islands
        # start from island-2, see if we can reach island-1
        # gradually increase the area of island-2
        pick, tgt = 2, 1

        # BFS/stack
        def findL(stack):
            k = 0
            while k < len(stack):
                i, j, L = stack[k]
                for p, q in [(i+1,j),(i-1,j),(i,j+1),(i,j-1)]:
                    if 0 <= p < len(A) and 0 <= q < len(A[0]):
                        if A[p][q] == tgt:
                            return L
                        elif A[p][q] == 0:
                            A[p][q] = pick
                            stack.append((p,q,L+1))
                k += 1
            return float('inf')
                    
        st = []
        for e in self.edges:
            st.append((e[0], e[1], 1))
            A[e[0]][e[1]] = pick
        
        return findL(st)




